import React from "react";

const Nav = () => {
    return (
        <nav className="navbar navbar-expend-md navbar-dark bg-dark">
            <ul className="navbar-nav mr-auto">
                <li className="nav-item">
                    <a href="/" className="nav-link">Home</a>
                    <a href="/" className="nav-link">Home</a>

                </li>
            </ul>
        </nav>
    )
}

export default Nav;
